import React from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import "./styles/landing.css";

const Landing = () => {
    let navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };

    return (
        <div className="container-main">
            <motion.div className="section main-landing-section"
                initial={{ scale: 0.5 }}
                animate={{ scale: 1 }}
            >
                <div className="content-box">
                    <h1>One place for all of your digital receipts, absolutely zero email sorting involved.</h1>
                    <button className="btn main-trial-button" onClick={() => handleNavigate('/preregister')}>
                        Try OneReturn for personal use
                    </button>
                </div>
            </motion.div>

            <div className="section for-business">
                <div className="content-box">
                    <h1>Use OneReturn for your business</h1>
                    <div className="info-section">
                        <h3>
                            The average person has 1.75 email accounts, the average office worker receives 121 emails each day, and over 162 billion spam emails were sent every day in 2022;
                            odds are: your customer's digital receipts are getting lost.
                        </h3>
                    </div>
                    <div className="info-section">
                        <h3 id='biz-info'>
                            OneReturn provides the all-in-one solution for getting your customers their receipts in an easy find, easy to manage way, on both your and the customers end.
                            Not only are OneReturn receipts searchable by any and all fields, they are formatted in an easy to read way and dynamic so customers can see live updates, such as a return, refund,
                            or shipment status.
                        </h3>
                        <a href='https://console.onereturn.com/preregister' className="btn main-trial-button">Try OneReturn for business</a>
                    </div>
                </div>
            </div>

            <div className="section pricing">
                <div className="content-box">
                    <h3>PRICING</h3>
                    <h2>Undetermined</h2>
                </div>
            </div>
        </div>
    );
}

export default Landing;
